import React, { useContext } from "react";
import LineChart from "../../components/ui/LineChart";
import DataTable from "../../components/ui/DataTable";
import { ThemeContext } from "../../context/Theme";

const lineChartData = {
  labels: [
    "January", "February", "March", "April", "May", "June",
    "July", "August", "September", "October", "November", "December"
  ],
  datasets: [
    {
      label: "Admin Accounts",
      data: [2, 3, 4, 5, 3, 6, 7, 2, 4, 5, 6, 7],
      backgroundColor: "rgba(75,192,192,0.4)",
      borderColor: "rgba(75,192,192,1)",
      borderWidth: 2,
      pointBackgroundColor: "rgba(75,192,192,1)",
    },
  ],
};

const accvalues = [
  { id: 1, username: "OhMama", email: "johny@gmail.com", date: "28 Jan", status: "Active" },
  { id: 2, username: "OhMuscle", email: "masku@gmail.com", date: "25 Jan", status: "Active" },
  { id: 3, username: "Alahooooo!", email: "abdul@gmail.com", date: "20 Jan", status: "Disabled" },
  { id: 4, username: "Lalalala", email: "wsmith@gmail.com", date: "15 Jan", status: "Disabled" },
  { id: 5, username: "Yeaaaahh!", email: "ESing@gmail.com", date: "14 Jan", status: "Active" },
];

export const AdminManagement = ({ setSelected }) => {
  const [theme] = useContext(ThemeContext);
  const bgColor = theme === "night" ? "bg-gray-800" : "bg-gray-100";

  return (
    <div className={`col-span-8 overflow-hidden rounded-lg text-xs md:text-md px-8 py-4 ${bgColor}`}>
      <div className="flex justify-between items-center my-4">
        <h1 className="text-2xl font-semibold">Admin Accounts</h1>
        <button
          id="add-account"
          onClick={() => setSelected("AddAdminAccount")}
          className="bg-blue-500 hover:bg-blue-600 text-white font-bold py-2 px-4 rounded"
        >
          + Add Account
        </button>
      </div>

      <DataTable setSelected={setSelected} accvalues={accvalues} />

      <div className="pt-4">
        <div className="rounded-xl p-5 shadow-md flex flex-col gap-5 max-w-2xl">
          <LineChart title_text={"Recent Admin Activity"} data={lineChartData} />
        </div>
      </div>
    </div>
  );
};
